import React, {useEffect} from 'react';
import { useParams } from 'react-router-dom';
import ImageSlider from '../helpers/ImageSlider';
import { SliderData } from '../helpers/SliderData';

function Locations() {
  let { id } = useParams();
  useEffect(() => {
    console.log('ID:', id);
  }, [id]);
  console.log(id);
  const sliderData = SliderData.find(slide => slide.id === parseInt(id));
  

  return (
    <div>
      <h1>Image Slider</h1>
      {sliderData && <ImageSlider images={sliderData.images} />}
    </div>
  );
}

export default Locations;
